import React from "react";

const Firstpage = () => {
  return (
    <div>
      <div className="container">
        <div className="row w-auto d-flex align-items-center " style={{ height: "90vh" }}>
          <div className="col-md-6 firstElem" style={{ border: "2px solid" }}>
            <h1>
              <span>Get Fit,</span> Strong & Motivated
            </h1>
            <button type="button" class="btn btn-outline-primary btn-lg">
              Register Now
            </button>
          </div>
          <div className="col-md-6" style={{ border: "2px solid" }}></div>
        </div>
      </div>
    </div>
  );
};

export default Firstpage;
